(* This is a super-naive implementation, that worked because description, examples and input for part 1 did not include any edge cases. Let this stay here as memento. *)
let risk area = 
    let arr = Array.concat (List.map Array.of_list area) in
    let n = List.length area in
    for k = 2*n-3 downto 0 do
    	for l = 0 to k do
    		let i = l in let j = k-l in
    		if i < n-1 && j < n-1 then
    			let x = arr.(i*n+j) in
    			let y = arr.((i+1)*n+j) in
    			let z = arr.(i*n+j+1) in
    			arr.(i*n+j) <- x + if y < z then y else z;
			else if i < n-1 && j < n then
				arr.(i*n+j) <- arr.(i*n+j) + arr.((i+1)*n+j)
			else if j < n-1 && i < n then
				arr.(i*n+j) <- arr.(i*n+j) + arr.(i*n+j+1)
    	done;
    done;
    arr.(0) - List.hd (List.hd area);;

Printf.printf "%d\n" (risk inp);;

let rec update l i j n = match (l) with
	| [] -> [((i,j),n)]
	| ((a,b),k) :: rest -> 
		if a = i && b = j then
			if n < k then
				((a,b),n) :: rest
			else
				((a,b),k) :: rest
		else
			((a,b),k) :: update rest i j n

module Ints = Set.Make(Int)

let rec purge ready cand n m = match (cand,n) with
	| ([], _) -> []
	| (cand, 0) -> cand
	| (((a,b),c) :: rest, n) -> if Ints.mem (a*m+b) ready then purge ready rest (n-1) m else ((a,b),c) :: purge ready rest (n-1) m;;
	

let risk2 area = 
    let n = List.length area in
	let m = 5*n in
	let arr = Array.init (m*m) (fun k ->
										let i = k / m in
										let j = k mod m in
										let inc = (i/n+j/n) in
										let x = inc + List.nth (List.nth area (i mod n)) (j mod n) in
										x mod 10 + x / 10) in
	let get i j = if i >= 0 && j >= 0 && i < m && j < m then arr.(i*m+j) else Int.max_int/2 in
    let dist = Array.make (25*n*n) Int.max_int in
	let cand = ref [((0,0),0)] in
	let ready = ref Ints.empty in
	let loop = ref true in
	while !loop do
		cand := List.sort (fun (a,b) (c,d) -> Int.compare b d) !cand;
		let ((i,j),d) = List.hd !cand in
		dist.(i*m+j) <- d;
		ready := Ints.add (i*m+j) (!ready);
		cand := List.tl !cand;
		cand := update !cand (i-1) j (d+get (i-1) j);
		cand := update !cand (i+1) j (d+get (i+1) j);
		cand := update !cand i (j-1) (d+get i (j-1));
		cand := update !cand i (j+1) (d+get i (j+1));
		cand := purge !ready !cand 4 m;
		loop := not (Ints.mem (m*m-1) !ready)
    done;
    dist.(m*m-1);;
	

Printf.printf "%d\n" (risk2 inp);;

